import React from 'react';

class StorePicker extends React.Component {
    render(){
        return (
            <>
                <p>FORM</p>
                <form>
                    <h2>Please Enter a Store</h2>
                    <input type="text" required placeholder="Store Name"/>
                    <button type="submit"/>
                </form>
            </>
        )
    }
}

export default StorePicker;
